INSERT INTO `roomtype` (`typeID`, `name`, `rate`, `beds`, `description`) VALUES
(1, 'Studio', '100.25', 1, 'Studio: A room with a studio bed – a couch that can be converted into a bed. May also have an additional bed.'),
(2, 'Single', '110.25', 1, 'Single: A room assigned to one person. May have one or more beds.'),
(3, 'Double', '140.55', 2, 'Double: A room assigned to two people. May have one or more beds.'),
(4, 'Triple', '160.10', 3, 'Triple: A room assigned to three people. May have two or more beds.'),
(5, 'Quad', '180.99', 4, 'Quad: A room assigned to four people. May have two or more beds.'),
(6, 'Queen', '230.00', 1, 'Queen: A room with a queen-sized bed. May be occupied by one or more people.'),
(7, 'King', '250.00', 1, 'King: A room with a king-sized bed. May be occupied by one or more people.'),
(8, 'Twin', '145.55', 2, 'Twin: A room with two beds. May be occupied by one or more people.'),
(9, 'Double-double', '220.50', 2, 'Double-double: A room with two double (or perhaps queen) beds. May be occupied by one or more people.'),
(10, 'Mini-Suite', '280.11', 1, 'Mini-Suite or Junior Suite: A single room with a bed and sitting area. Sometimes the sleeping area is in a bedroom separate from the parlour or living room.'),
(11, 'Master Suite', '299.99', 2, 'Master Suite: A parlour or living room connected to one or more bedrooms.');
